"AcadSoc_Launcher" is a Google Chrome extension created to simplify the workflow of teachers in Online Academic Society;

The extension contains several links for tools that teachers use on daily basis like:

The link for official website;
The link for IM tool that teachers use for communication with administration.
The link for Cambridge dictionary;
The link for the oficial FB group;
The link for the official YT channel;

